public class InnerDashboardDashboardPublishOptionsFactory(Action<Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions> factoryAction = null) : SubResourceFactory<Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions>
{

    internal InnerDashboardSheetControlsOptionFactory SheetControlsOptionFactory { get; set; }

    internal InnerDashboardExportToCSVOptionFactory ExportToCSVOptionFactory { get; set; }

    internal InnerDashboardDataPointMenuLabelOptionFactory DataPointMenuLabelOptionFactory { get; set; }

    internal InnerDashboardDataPointDrillUpDownOptionFactory DataPointDrillUpDownOptionFactory { get; set; }

    internal InnerDashboardAdHocFilteringOptionFactory AdHocFilteringOptionFactory { get; set; }

    internal InnerDashboardDashboardVisualPublishOptionsFactory VisualPublishOptionsFactory { get; set; }

    internal InnerDashboardVisualMenuOptionFactory VisualMenuOptionFactory { get; set; }

    internal InnerDashboardDataPointTooltipOptionFactory DataPointTooltipOptionFactory { get; set; }

    internal InnerDashboardVisualAxisSortOptionFactory VisualAxisSortOptionFactory { get; set; }

    internal InnerDashboardExportWithHiddenFieldsOptionFactory ExportWithHiddenFieldsOptionFactory { get; set; }

    internal InnerDashboardSheetLayoutElementMaximizationOptionFactory SheetLayoutElementMaximizationOptionFactory { get; set; }

    protected override Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions Create()
    {
        var dashboardPublishOptionsResult = CreateDashboardPublishOptions();
        factoryAction?.Invoke(dashboardPublishOptionsResult);

        return dashboardPublishOptionsResult;
    }

    private Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions CreateDashboardPublishOptions()
    {
        var dashboardPublishOptionsResult = new Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions();

        return dashboardPublishOptionsResult;
    }
    public override void CreateChildren(Humidifier.QuickSight.DashboardTypes.DashboardPublishOptions result)
    {
        base.CreateChildren(result);

        result.SheetControlsOption ??= SheetControlsOptionFactory?.Build();
        result.ExportToCSVOption ??= ExportToCSVOptionFactory?.Build();
        result.DataPointMenuLabelOption ??= DataPointMenuLabelOptionFactory?.Build();
        result.DataPointDrillUpDownOption ??= DataPointDrillUpDownOptionFactory?.Build();
        result.AdHocFilteringOption ??= AdHocFilteringOptionFactory?.Build();
        result.VisualPublishOptions ??= VisualPublishOptionsFactory?.Build();
        result.VisualMenuOption ??= VisualMenuOptionFactory?.Build();
        result.DataPointTooltipOption ??= DataPointTooltipOptionFactory?.Build();
        result.VisualAxisSortOption ??= VisualAxisSortOptionFactory?.Build();
        result.ExportWithHiddenFieldsOption ??= ExportWithHiddenFieldsOptionFactory?.Build();
        result.SheetLayoutElementMaximizationOption ??= SheetLayoutElementMaximizationOptionFactory?.Build();
    }

} // End Of Class

